import React from 'react';
import Paper from "@material-ui/core/Paper";

function Question({index, getQuestionId, id, question, questionId}){

    const q = () => {
        getQuestionId(2);
    };

    console.log(q.title);

    return(
        <Paper
            key={index}
        >
            <h1>Detail's page</h1>  
            <p>{question.title}</p>


        </Paper>
    )
}

export default Question;
